Event.create(title:"Hot 97 Summer Jam", category:"Music", location:"Met Life Stadium, New Jersey", description:"Summer Jam is the annual hip-hop fest held in East Rutherford, New Jersey and sponsored by New York-based radio station Hot 97FM. Normally held in June, the concert features the most popular acts that hip hop and R&B have to offer in a particular year. The hip-hop summer festival format was originally pioneered and popularized by San Francisco radio station KMEL with their large-scale Summer Jam concerts from 1987 through the 1990s and present day.KMEL continues to host smaller versions of the event annually. Similarly, Los Angeles station KKBT held an annual Summer Jam hip-hop concert during the 1990s after hiring KMEL's Program Director in 1993. ", date_time:"2020-06-19 14:00".to_time, img_url:"data:image/png;base64,")

