Event.create(title:"Electric Zoo 2020", category:"Music", location:"Randall's Island Park, New York", description:"Electric Zoo is an annual electronic music festival held over Labor Day weekend in New York City on Randall's Island. The festival represents all genres of electronic music, bringing top international DJs and live acts from multiple countries to four stages.In its 2009 inaugural year, 26,000 people attended to see artists Armin van Buuren, Deadmau5, David Guetta and Ferry Corsten. In 2011, Electric Zoo expanded to a 3-day festival and with 85,000 attendees. Electric Zoo received International Dance Music Awards nominations in 2010, 2011, 2012, and 2013 for Best Music Event.", date_time:"2020-09-04 12:00".to_time, img_url:"data:image/jpeg;base64,")

