Event.create(title:"Domestic Violence Support", category:"Charity and Causes", location:"120 Schermerhorn St, Brooklyn, NY 11201", description:"1 in 4 women and 1 in 9 men experience severe intimate partner physical violence, intimate partner contact sexual violence, and/or intimate partner stalking with impacts such as injury, fearfulness, post-traumatic stress disorder, use of victim services, contraction of sexually transmitted diseases, etc. If you or anyone you know is experiencing any form of domestic violence, please come see us.", date_time:"2020-06-20 05:00".to_time, img_url:"data:image/png;base64,")

Event.create(title:"Beyonce & Jay Z: On The Run Tour II", category:"Music", location:"Citi Field, New York", description:"The On the Run Tour was a co-headlining stadium tour by American performer Beyoncé and rapper Jay-Z, also known as duo The Carters. The joint tour came shortly after the two had finished their own solo tours — Beyoncé's The Mrs. Carter Show World Tour and Jay-Z's Magna Carter World Tour.On May 31, it was announced via Twitter that R&B duo Chloe x Halle and DJ Khaled would be the opening acts for the North American leg of the tour.", date_time:"2020-07-30 08:00".to_time, img_url:"https://upload.wikimedia.org/wikipedia/en/thumb/1/14/On_the_Run_Tour_poster.jpg/220px-On_the_Run_Tour_poster.jpg")

Event.create(title:"Stand Against Racism: Voting in a Time of Crisis", category:"This Weekend", location:"Zoom", description:"As the August and November elections approach, we must equip ourselves with the knowledge and tools to advocate for our most vulnerably positioned community members to have access to the ballot. Join us virtually to learn about the state of felony disenfranchisement in Tennessee, voter restoration campaigns, absentee voting, and what you can do to advocate for expanded access to the ballot.", date_time:"2020-06-21 12:00".to_time, img_url:"https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F102017410%2F232364108062%2F1%2Foriginal.20200527-205052?w=1080&auto=format%2Ccompress&q=75&sharp=10&rect=0%2C506%2C4048%2C2024&s=66bc2b23804fd656de6e0f7946446700")

