Event.create(title:"Kiss: End Of The Road World Tour", category:"Music", location:"Madison Square Garden, New York", description:"The End of the Road World Tour is the ongoing final concert tour by the American rock band Kiss. The tour began on January 31, 2019 at the Rogers Arena in Vancouver, Canada and is set to end on July 17, 2021, with a final show in New York City. The tour was announced on September 19, 2018, following a performance of Detroit Rock City on America's Got Talent. Tour dates were officially announced for North America, Europe and Oceania on October 30, 2018.", date_time:"2020-06-30 07:00".to_time, img_url:"https://www.ft.com/__origami/service/image/v2/images/raw/http%3A%2F%2Fcom.ft.imagepublish.upp-prod-us.s3.amazonaws.com%2Fade583b4-9ccf-11e9-9c06-a4640c9feebb?fit=scale-down&source=next&width=700")

Event.create(title:"Jennifer Lopez: It's My Party", category:"Music", location:"Madison Square Garden, New York", description:"It's My Party was the fourth concert tour by American entertainer Jennifer Lopez. The tour was announced during her appearance on The Ellen DeGeneres Show on February 13, 2020. The North American leg of the tour began on June 7, 2019, in Inglewood and ended on July 27, 2020, in Miami, after performing 32 shows in Canada and the United States. Lopez then performed six international shows, starting in Tel Aviv on August 1, 2019, and ending in Saint Petersburg on August 11, 2020.", date_time:"2020-06-19 10:00".to_time, img_url:"data:image/jpeg;base64,")

