Event.create(title:"J. Cole: KOD Tour", category:"Music", location:"Madison Square Garden, New York", description:"The KOD Tour was the eighth headlining concert tour by American recording artist J. Cole, in support of his fifth studio album, KOD. The tour began on June 9, 2020 in Miami at the American Airlines Arena and would conclude on October 10, 2020 in Boston at TD Garden. Jermaine Lamarr Cole is an American rapper, singer, songwriter, producer, and record executive. Born on a military base in Germany and raised in Fayetteville, North Carolina, Cole initially gained recognition as a rapper following the release of his debut mixtape, The Come Up, in early 2007.", date_time:"2020-06-25 07:00".to_time, img_url: "data:image/jpeg;base64,")

