Event.create(title:"NBA Debate Club", category: "This Weekend", location:"Zoom (Link will be provided through email sign up)", description:"Come join a group of wannabee NBA experts and debate who the real GOAT of the NBA is! You will be accompanied by many Flatiron School students who have failed their careers as sports analysts and decided to become software engineers, and data scientists. All those who openly want to criticize the likes of famous ESPN analysts such as Stephen A. Smith, and Skip Bayless are more than welcome!", date_time:"2020-06-20 7:00".to_time, img_url: "data:image/jpeg;base64," )

Event.create(title:"Virtual Happy Hour", category:"This Weekend", location:"Anywhere, Virtually!!, not really, we will be on Zoom", description:"In a matter of a few weeks, the world has become a different place.What is a virtual happy hour? It’s exactly what it may sound like it is. Choose a platform, create a meeting time, and send out invites to friends or loved ones. Then, gather together with a libation or a snack, and catch up - from across town, or across the world.", date_time:"2020-06-21 05:00".to_time, img_url:"data:image/png;base64,")

Event.create(title:"Candella: Mexican Cuisine", category:"Food and Drink", location:"Queens, New York", description:"Mexican cuisine began about 9,000 years ago, when agricultural communities such as the Maya formed, domesticating maize, creating the standard process of maize nixtamalization, and establishing their foodways. Successive waves of other Mesoamerican groups brought with them their own cooking methods. These included the Olmec, Teotihuacanos, Toltec, Huastec, Zapotec, Mixtec, Otomi, Purépecha, Totonac, Mazatec, and Mazahua. The Mexica establishment of the Aztec Empire created a multi-ethnic society where many different foodways became infused.", date_time:"2020-06-22 05:00".to_time, img_url:"data:image/jpeg;base64,")


Event.create(title:"How To Help The Enviroment(Moved to virtual due to COVID-19)", category:"Charity and Causes", location:"Zoom", description:"Environmental issues are harmful effects of human activity on the biophysical environment. Environmental protection is a practice of protecting the natural environment on the individual, organizational or governmental levels, for the benefit of both the environment and humans. Our objectives are to conserve natural resources and the existing natural environment and, where possible, to repair damage and reverse trends.", date_time:"2020-06-27 05:00".to_time, img_url:"data:image/jpeg;base64,")

Event.create(title:"Help Fight Homelessness in New York City", category:"Charity and Causes", location:"Timess Square, New York City", description:"In March 2020, there were 60,923 homeless people, including 14,097 homeless families with 20,939 homeless children, sleeping each night in the New York City municipal shelter system. Families make up more than two-thirds of the homeless shelter population. Over the course of City fiscal year 2019, 132,660 different homeless men, women, and children slept in the New York City municipal shelter system. This includes over 44,300 different homeless New York City children.", date_time:"2020-07-01 05:00".to_time, img_url:"https://content.fortune.com/wp-content/uploads/2015/09/gettyimages-453561177.jpg")


Event.create(title:"Black Lives Matter: Brooklyn Edition", category:"Charity and Causes", location:"Barclay Center, Brooklyn", description:"#BlackLivesMatter was founded in 2013 in response to the acquittal of Trayvon Martin’s murderer. Black Lives Matter Foundation, Inc is a global organization in the US, UK, and Canada, whose mission is to eradicate white supremacy and build local power to intervene in violence inflicted on Black communities by the state and vigilantes. By combating and countering acts of violence, creating space for Black imagination and innovation, and centering Black joy, we are winning immediate improvements in our lives.", date_time:"2020-06-22 05:00".to_time, img_url:"data:image/jpeg;base64,")

Event.create(title:"Alzheimer's and Brain Awareness March", category:"Charity and Causes", location:"Downtown, New York City", description:"Alzheimer’s disease is a degenerative brain disease and the most common form of dementia. Dementia is not a specific disease. It's an overall term that describes a group of symptoms. Alzheimer's is the most common form of dementia, a general term for memory loss and other cognitive abilities serious enough to interfere with daily life.", date_time:"2020-06-17 05:00".to_time, img_url:"data:image/jpeg;base64,")

Event.create(title:"PETA: Come Learn More!", category:"Charity and Causes", location:"Downtown, New York City", description:"People for the Ethical Treatment of Animals is an American animal rights organization based in Norfolk, Virginia, and led by Ingrid Newkirk, its international president. A nonprofit corporation with nearly 400 employees, it claims that it has 6.5 million members and supporters, in addition to claiming that it is the largest animal rights group in the world.", date_time:"2020-06-22 05:00".to_time, img_url:"data:image/png;base64,")

Event.create(title:"New York City Pride March", category:"Charity and Causes", location:"Manhattan, New York City", description:"New York City Pride March is an event celebrating the LGBTQ community; it is one of the largest annual Pride marches in the world, attracting tens of thousands of participants and millions of sidewalk spectators each June. Come join us and show your support for the LGBTQ+ community!", date_time:"2020-06-22 12:00".to_time, img_url:"data:image/jpeg;base64,")


Event.create(title:"#BLM", category:"Charity and Causes", location:"Central Park, Manhattan", description:"Black Lives Matter is an international human rights movement, originating from within the African-American community, which campaigns against violence and systemic racism towards black people.An organization known simply as #Black Lives Matter exists as a decentralized network with over 30 chapters worldwide, while a larger Black Lives Matter movement exists consisting of various separate like-minded organizations such as Dream Defenders and Assata's Daughters.", date_time:"2020-06-17 05:00".to_time, img_url:"data:image/png;base64,")

Event.create(title:"Pizza Zoo NYC", category:"Food and Drink", location:"NYC", description:"Four New Yorkers have created an experience that's both reminiscent of childhood fun, but caters to an adult appetite: alcohol and endless amounts of pizza. The Pizza Zoo creators credit their growing ticket sales to the power of social media.", date_time:"2020-06-22 05:00".to_time, img_url:"data:image/jpeg;base64,")

